import Header from './Header'
import Content from './Content'
import Total from './Total'

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course={course}/>
      <Content part1={part1.name} exercises1={part1.exercises1} exercises2={part1.exercises2} exercises3={part1.exercises3} part2={part2.name} part3={part3.name}/>
      <Total exercises1={part1.exercises1} exercises2={part1.exercises2} exercises3={part1.exercises3}/>
    </div>
  )
}

export default App
